"lt94": "Estimados lectores, aquellos que han experimentado diabetes en sus hogares o familiares, ¡tengo buenas noticias para ustedes!",

"lt95": "Sabéis que soy profesor de endocrinología en los institutos nacionales de salud, tengo 25 años de experiencia. Y estoy constantemente interesado en las noticias de esta área y trato de asistir a grandes eventos siempre que sea posible.",

"lt96": "El otro día asistí a la conferencia de la OMS sobre la diabetes y ahora puedo decir con confianza: esta enfermedad ahora no es una sentencia de muerte. ¡La diabetes tipo 2 (adquirida) se puede curar por completo!",

"lt97": "los Líderes de las potencias mundiales se unieron y financiaron un proyecto para desarrollar el último remedio, llamado <a href=\"\">Dianol</a> .",

"lt98": "Estamos acostumbrados a pensar que la diabetes se refiere a enfermedades metabólicas persistentes e irreversibles, en las que los pacientes siguen una dieta estricta, controlan constantemente los niveles de azúcar en la sangre y toman medicamentos de por vida.",

"lt99": "Entonces, la principal diferencia de <a href=\"\">Dianol</a> es que no necesita tomarse de por vida. Según los resultados de la investigación, solo un tratamiento de esta herramienta ayudó al 92% de los sujetos a estar completamente sanos.",

"lt100": "La diabetes tipo dos se caracteriza por una resistencia persistente del cuerpo a la insulina, y los principales procesos patológicos en esta enfermedad ocurren en el páncreas. Dianol restaura las células dañadas de este órgano, establece su correcto funcionamiento y restaura el equilibrio hormonal.",

"lt101": "Además, Dianol estimula la síntesis de insulina por las células ß del páncreas, satura los tejidos periféricos con glucosa, reduce su absorción en el tracto intestinal y ralentiza el crecimiento de la glucosa en la sangre. Por lo tanto, la dieta de la persona puede ampliarse notoriamente, podemos agregarle incluso aquellos alimentos que solían estar bajo una prohibición estricta.",

"lt102": "Y especialmente para mis lectores, tengo una información privilegiada: <a href = \"\">Dianol</a> ya está a la venta. Mientras todo esto funciona en modo de prueba, y hasta <span class =\"data\">02.09.2021</span> puede comprar Dianol con un descuento del 50% en el sitio especialmente creado, comparto el enlace:",

